module.exports = "<h1>Das Reglement zur Tipp-Kick Saison:</h1>\r\n\r\n<h3>Ligabetrieb</h3>\r\n<p>Gespielt wird im Modus \"Double Round Robin\", d.h. jeder Spieler spielt gegen jeden \r\n  anderen Spieler 2 Mal (Hin- und R√ºckspiel). Bei 7 Spielern ergeben das 14 Spieltage, wobei \r\n  immer ein Spieler pro Spieltag spielfrei hat.</p>\r\n<p>Ein gewonnenes Spiel wird mit 3 Punkten bewertet. F√ºr ein Unentschieden gibt es noch 1 Punkt, \r\n  w√§hrend man f√ºr eine Niederlage 0 Punkte bekommt. Die Punkte werden mitsamt der geschossenen \r\n  und kassierten Tore in einer Tabelle aufsummiert. Die Reihenfolge innerhalb der Tabelle wird nach \r\n  folgenden Kriterien bestimmt:</p>\r\n<ul>\r\n    <li>Erreichte Punkte</li>\r\n    <li>Tordifferenz</li>\r\n    <li>Anzahl erzielter Tore</li>\r\n    <li>Anzahl gespielter Spiele</li>\r\n</ul>\r\n\r\n<h3>Pokal-Modus</h3>\r\n<p>Gespielt wird im K.O.-System mit Hin- und R√ºckspiel (\"Europapokalregelung\"). Lediglich \r\n  im Finale wird nur ein einziges Spiel bestritten. Bei 7 Spielern ergibt sich ein Turnierbaum \r\n  ab Viertelfinale, wobei ein Spieler ein Freilos erh√§lt und erst ab Halbfinale in den \r\n  Spielbetrieb einsteigt.</p>\r\n\r\n<h3>Spielfeld</h3>\r\n<p>Gespielt wird auf dem Spielfeld des E31 Infrastruktur Teams (Tipp-Kick Junior Cup).</p>\r\n\r\n<h3>Spielfigur</h3>\r\n<p>Gespielt wird mit einem Kicker und einem Torwart. Jeder Spieler ist dazu berechtigt, seine eigenen Spielfiguren mitzubringen und einzusetzen, sofern diese als Tipp-Kick Figuren deklariert sind und die √ºblichen Dimensionen aufweisen.\r\nEs k√∂nnen auch die dem Spiel beiliegenden Figuren verwendet werden.</p>\r\n\r\n<h3>Ball</h3>\r\n<p>Gespielt wird mit einem Tipp-Kick-Ball in den Farben schwarz und wei√ü. Zu Spielbeginn \r\n  einigen sich die Spieler darauf, wer mit welcher Farbe spielt. Bei Uneinigkeit darf der Spieler, \r\n  der gem√§√ü Spielplan das Heimrecht hat, entscheiden.</p>\r\n<p>Der Ball wird durch das Bet√§tigung des Knopfes √ºber dem Kopf des Kickers und der damit \r\n  verursachten Bewegung des Schu√übeines bewegt. Der Ball darf mit dem Kicker weder geschoben, \r\n  noch ohne Bet√§tigung des Knopfes bewegt werden.</p>\r\n<p>Es darf nur gespielt werden, wenn die eigene Farbe oben auf dem Ball zu sehen ist. Eine Ausnahme \r\n  zu dieser Regel bildet der Torwart, der den Ball bei jeder Farbe spielen darf.</p>\r\n\r\n<h3>Spielzeit</h3>\r\n<p>Gespielt wird 2 x 5 Minuten. In der Halbzeit m√ºssen die Seiten gewechselt werden. \r\n  Benutzen beide Spieler die dem Spiel beiliegenden Spielfiguren, so tauschen die Spieler diese \r\n  jetzt, was effektiv dazu f√ºhrt, dass die Spielfiguren auf ihren Seiten verbleiben.\r\nIm Pokal-Modus kann es zu einer Verl√§ngerung kommen, die mit weiteren 2 x 2 Minuten Spielzeit \r\nund einem Seitenwechsel abgebildet wird. Sollte auch danach noch kein Sieger feststehen, so \r\ngibt es ein Elfmeterschie√üen, bei dem die Spieler 5 Mal abwechselnd auf das jeweils gegnerische \r\nTor schie√üen. Das Elfmeterschie√üen kann in den \"Sudden Death\"-Modus verl√§ngert werden, bei dem \r\nimmer jeweils ein weiterer Elfmeter pro Spieler ausgef√ºhrt wird, solange bis eine Entscheidung \r\nherbeigef√ºhrt wurde.<p>\r\n\r\n<h3>Abwehr</h3>\r\n<p>Der Kicker als abwehrende Spielfigur muss mind. 2 Kickerl√§ngen Abstand zum Ball halten und darf dabei \r\n  niemals im eigenen Strafraum positioniert werden. Sollte sich der Ball in weniger als 2 Kickerl√§ngen \r\n  Abstand zum eigenen Strafraum befinde, so darf der Kicker dennoch gesetzt werden, muss mit der Fu√üspitze \r\n  jedoch die Strafraumlinie ber√ºhren. Der Kicker als abwehrende Spielfigur darf nicht festgehalten oder \r\n  bewegt werden, w√§hrend der angreifende Spieler den Ball spielt.<p>\r\n\r\n<h3>Freisto√ü/Elfmeter</h3>\r\n<p>Wenn der Kicker als abwehrende Spielfigur den Ball abwehrt, dabei jedoch bewegt oder festgehalten \r\n  wurde, so erh√§lt die angreifende Mannschaft einen Freisto√ü bei dem 3 Kickerl√§ngen Abstand zu \r\n  halten sind. Das gleiche gilt, falls der Spieler in Abwehrposition den Ball mit der Hand ber√ºhrt. \r\n  Geschieht ein solcher Regelversto√ü innerhalb des Strafraums, so gibt es einen Elfmeter f√ºr die \r\n  angreifende Mannschaft. Es gibt auch dann einen Elfmeter, wenn ein Kicker als abwehrende Spielfigur \r\n  den Ball im eigenen Strafraum abwehrt. Der Elfmeter wird vom Elfmeterpunkt aus ausgef√ºhrt und der \r\n  abwehrende Torwart muss auf der Torlinie bleiben.<p>\r\n\r\n<h3>Torschuss</h3>\r\n<p>Es d√ºrfen von beinahe allen Positionen des Spielfeldes aus Tore erzielt werden. Die Ausnahmen \r\n  sind Ansto√ü (zu Beginn einer Halbzeit bzw. nach Torerfolg des Gegners), Absto√ü und Einwurf. \r\n  Auch indirekte Tore, bei denen eine der gegnerischen Spielfiguren den Ball noch ber√ºhrt, z√§hlen \r\n  hier nicht. Ein Eckball hingegen darf sogar direkt verwandelt werden.<p>\r\n\r\n<h3>Schiedsrichter</h3>\r\n<p>Sofern m√∂glich, ist eine dritte Person als Schiedsrichter dazu zu holen. Diese kann bei \r\n  strittigen Entscheidungen (z.B. Tor/kein Tor) entscheiden.<p>"

